import NavBar from './components/NavBar'
import AboutMe from './components/AboutMe'
import TechSkills from './components/TechSkills'
import Footer from './components/Footer'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <NavBar />


      <Switch>
          <Route path="/">
          <AboutMe />
          <TechSkills />
          </Route>
          <Route path="/contact">

          </Route>
          <Route path="/project">

          </Route>

        </Switch>
    </Router>
  );
}

export default App;
